import React from 'react';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate
} from 'react-router-dom';
import './App.css';
import Auth from './screens/Auth';


function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={!loggedIn?<Auth />:<Navigate to="/home" />} />
      </Routes>

    </Router>
  );
}

export default App;
